import React, { Component } from 'react';
import './App.css';

class PrivacyPolicy extends Component {
    render() {
      return (
        <div>
          <h1> Privacy Policy </h1>
          <div> 
            <p> Your privacy is important to us. It is Simple OKRs' policy to respect your privacy regarding any information we may collect from you across our website and Slack app.</p>
            <p> We only ask for personal information when we truly need it to provide a service to you. We also let you know why we're collecting it and how it will be used.</p>
            <p>We don't share any personally identifying information publicly or with third-parties, except when required to by law or explicitly authorized by you.</p>
            <h3> Data we collect and store </h3>
            <p> Simple OKRs collects basic user information about team members when the application is installed:</p>
            <ul>
              <li>Slack ID</li>
              <li>Name</li>
              <li>Email</li>
              <li>IP Addess</li>
            </ul>
            <p> Using standard web analytics and web server technologies, Simple OKRs system logs your navigation actions, IP address, cookies and other information provided by your web browser.</p>
            <p> Web connections to Simple OKRs services are encrypted via SSL, which means that all data on transit is encrypted</p>
            <h3> Questions </h3>
            <p>If you have questions or concerns about how your information is handled, please direct your inquiry to smcoleman27@gmail.com</p>
          </div>
        </div>
      )
    }
}

export default PrivacyPolicy;
